var reviewFormHandler=a=>{a.preventDefault();const b=document.querySelector("#review-title").value.trim(),c=document.querySelector("#safety-culture").value,d=document.querySelector("#safety-training").value,e=document.querySelector("#hazard-id").value,f=document.querySelector("#lead-emphasis").value,g=document.querySelector("#safety-manager").value,h=document.querySelector("#additional-content").value;console.log(g);let i=managerCheck(g);var j=window.location.pathname,k=j.substring(j.lastIndexOf("/")+1);if(b&&c&&d&&e&&f&&i&&h){fetch("/query/reviews/"+k,{method:"POST",body:JSON.stringify({title:b,safety_culture:c,safety_training:d,hazard_id:e,lead_emphasis:f,safety_manager:i,contents:h}),headers:{"Content-Type":"application/json"}})}};const managerCheck=a=>1==a?safety_manager=!0:void(0==a?safety_manager=!1:console.log("THIS CHECK IS BROKEN"));document.getElementById("review-submit").addEventListener("click",reviewFormHandler);